import React from "react";
import "./Footer.css";
function Footer() {
  return (
    <div className="footer_box">
      <div className="team_name">팀명 : 아는게 없조</div>
      <div className="01">기수 : BEB_01</div>
      <div className="team_member">팀원 : 김대익, 안창남, 유호진</div>
    </div>
  );
}

export default Footer;
